                'note' => 'Il Registro Imprese ? un registro pubblico che, gi? previsto dal Codice Civile, ha avuto completa attuazione a partire dal 1996, con la Legge relativa al riordino delle Camere di Commercio e con il successivo Regolamento di attuazione.

La Legge sopracitata ha istituito presso ciascuna Camera di Commercio l\'Ufficio del Registro Imprese, che ha le seguenti caratteristiche:

ha competenza provinciale;
? gestito secondo tecniche informatiche;
la sua tenuta ? affidata alla locale Camera di Commercio, sotto la vigilanza di un Giudice, delegato dal Presidente del Tribunale del capoluogo di Provincia;
? retto da un Conservatore nominato dalla giunta nella persona del Segretario Generale ovvero di un dirigente della Camera di Commercio che assicura la corretta tenuta del Registro Imprese in osservanza delle disposizioni in materia e delle decisioni del Giudice del Registro.

Il Registro Imprese pu? essere definito come l\'anagrafe delle imprese: vi si trovano infatti i dati (costituzione, modifica, cessazione) di tutte le imprese con qualsiasi forma giuridica e settore di attivit? economica, con sede o unit? locali sul territorio nazionale, nonch? gli altri soggetti previsti dalla legge.
Il Registro Imprese fornisce quindi un quadro completo della situazione giuridica di ciascuna impresa ed ? un archivio fondamentale per l\'elaborazione di indicatori di sviluppo economico ed imprenditoriale in ogni area di appartenenza.
