Costo del servizio di conta: 1% del contato
Costo del servizio di ritiro: E. 35,00+IVA a singolo servizio.

La consegna diretta dei valori presso la loro sede (La Vigile Via degli Incisa 11a - 17100 Savona) pu&ograve; essere effettuata dal luned&igrave; al venerd&igrave; (escluso festivi) dalle ore 8.00 alle ore 12.00. Si pu&ograve; sforare un po\' l\'orario ma non oltre le 13.30/14.00, pi&ugrave; che altro per noi perch&eacute; se arriviamo che ci sono i furgoni che scaricano rischiamo di attendere pi&ugrave; di 1 ora.
