Per la consegna diretta serve la la targa del mezzo che verr&agrave; usato per entrare nella sala conta e il documento della persona che andr&agrave; a fare il deposito. 
In caso di consegna diretta non abbiamo limiti di importo o di numero di sacchetti.
Le monete non serve che siano insacchettate divise per conio.

Per il ritiro presso la nostra sede hanno bisogno di una richiesta via mail da indirizzare a: trasportovalori@vigilanzalavigile.it con un preavviso di almeno 24 ore di preavviso e indicazione dell\'indirizzo del luogo di ritiro.
Fascia oraria del ritiro: 08:00 &ndash; 16:00
